import React from "react";

// Importiere die HTML-Datei (WebPack benötigt html-loader)
import statistics from "../Components/Statistics/statistics.html";
import RenderHtml from "react-native-render-html";
import {useWindowDimensions} from "react-native";

const source = {
    html: `
<p style='text-align:center;'>
  Hello World!
</p>`
};
const Graphs = () => {
    const { width } = useWindowDimensions();
    return (
        <RenderHtml
            contentWidth={width}
            source={source}
        />
    );
}


export default Graphs;
